                        nav: false
                    }
                });
                mapDeferred.addCallback(function(response){
                    var map = response.map;
                    if (map.loaded) {
                        runTests(response);
                    }
                    else {
                        dojo.connect(map, "onLoad", function(){
                            runTests(response);
                        });

                });
                mapDeferred.addErrback(function(error){

                });

            function runTests(response){
                doh.registerGroup("createmap.json.twolayer.tfcLayerTest", [{
                    name: "layerTest",
                    timeout: 6000,
                    runTest: function(t){
                    
                        var map = response.map;
                        var layerIds = map.layerIds;
                        var layer0 = map.getLayer(layerIds[0]);
						                        
                        t.assertEqual(1, layerIds.length);
                        t.assertTrue(layer0 instanceof esri.layers.ArcGISTiledMapServiceLayer);
                        t.assertEqual(layer0.url, "http://services.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer");
                        
                        var graphicsLayerIds = map.graphicsLayerIds;
						var graphicLayer0 = map.getLayer(graphicsLayerIds[0]);
                        
                        t.assertEqual(1, graphicsLayerIds.length);
                        t.assertTrue(graphicLayer0 instanceof esri.layers.FeatureLayer);
                       
                        t.assertEqual("__OBJECTID", graphicLayer0.objectIdField);
                        t.assertEqual("esriGeometryPoint", graphicLayer0.geometryType);
                        t.assertEqual(590, graphicLayer0.graphics.length);
                        t.assertTrue(graphicLayer0.visible);
						
                        var operationalLayers = response.itemInfo.itemData.operationalLayers;
                        t.assertEqual(1, operationalLayers.length);
                        
                        var featureCollection = operationalLayers[0].featureCollection;
						
						t.assertEqual(1, featureCollection.layers.length);
                        
                        var layer0 = featureCollection.layers[0];
                        t.assertTrue(layer0.visibility);
                                   
                    }
                    
                    
                }]);
                doh.run();
            }
